const PostPreview = (props) => {
  return (
    <div>
      <p>{props.date}</p>

      <link href={`/posts/${props.slug}`}>
        <h2>{props.title}</h2>
      </link>
      <p>{props.subtitle}</p>
    </div>
  );
};

export default PostPreview;
